                            <p></p>
                            <p>Become a giant walking dice and battle to the end of an ever-changing dungeon! Can you escape the cruel whims of Lady Luck?</p>
                            <p>In this new fast-paced deckbuilding roguelike from Terry Cavanagh (<a href=""https://store.steampowered.com/app/221640/Super_Hexagon/"" target=""_blank"" rel=""nofollow noopener"">Super Hexagon</a>, <a href=""https://store.steampowered.com/app/70300/VVVVVV/"" target=""_blank"" rel=""nofollow noopener"">VVVVVV</a>), Chipzel, and Marlowe Dobbe, you&#x27;ll fight monsters, find better loot, and level up your heroes as you work together to take down the Goddess of Fortune, Lady Luck herself. Balance your carefully planned strategies against the unknown of a dice roll.</p>
                            <p></p>
                            <p>Play as six different characters, each with their own unique play styles and abilities.</p>
                            <ul>
                                <li>The Thief, who steals random enemy equipment every turn!
                                </li>
                                <li>The Robot, who gains dice by playing a push-your-luck blackjack game!
                                </li>
                                <li>The Inventor, overcome with inspiration, who must destroy their own equipment after each fight to get parts for powerful new gadgets!
                                </li>
                                <li>and more!</li>
                            </ul>
                            <p>Master each class and figure out which one best fits your style in this charming world filled with a growing array of twists and secrets.</p>
                            <p>Can you make it out alive? Maybe, but luck is definitely not on your side.</p>
                            <p><em><em></em></em>
                            </p>
