<ul><li>Six wildly different playable classes: Warrior, Thief, Robot, Jester, Inventor and Witch.
</li><li>Dozens of enemies, ranging from Vacuum Cleaners that want to suck your blood, to creatures from Irish mythology, to suave malevolent snowmen.
</li><li>A catchy, upbeat and energetic soundtrack by Chipzel (previously, the musician from Super Hexagon).
</li><li>Beautiful and adorable artwork by Marlowe Dobbe.
</li><li>Procedurally generated for endless play-throughs.</li></ul>
